contract PRJX is Context, IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;

    mapping (address => uint256) private _rOwned;
    mapping (address => uint256) private _tOwned;
    mapping (address => mapping (address => uint256)) private _allowances;

    mapping (address => bool) private _isExcludedFromFee; // Account which pay or not pay transaction fee

    mapping (address => bool) private _isExcluded; // Accounts which receive rewards or not
    address[] private _excluded; // Accounts which does not receive rewards
    uint256 private constant MAX = ~uint256(0); 
    uint256 private _tTotal = 300 * 10**6 * 10**18;
    uint256 private _rTotal = (MAX - (MAX % _tTotal));

    uint256 private _tFeeTotal;

    string private _name = "ProjectX";
    string private _symbol = "PRJX";
    uint8 private _decimals = 18;

    uint256 public _taxFee = 0;
    uint256 private _previousTaxFee = _taxFee;

    uint256 public _burnFee = 0;
    uint256 private _previousBurnFee = _burnFee;

    uint256 public _teamFee = 0;
    uint256 private _previousTeamFee = _teamFee;

    address public immutable DEAD = address(0xdead);
    address public teamWallet;

    IUniswapV2Router02 public immutable uniswapV2Router;
    address public immutable uniswapV2Pair;

    bool inSwapAndSend;
    bool public swapAndSendEnabled = true;

    uint256 private numTokensSellToSend = _tTotal.mul(5).div(10000);

    event MinTokensBeforeSwapUpdated(uint256 minTokensBeforeSwap);
    event SwapAndSendEnabledUpdated(bool enabled);

    event SwapAndSend(
        uint256 tokensSwapped,
        uint256 ethSent
    );

    modifier lockTheSwap {
        inSwapAndSend = true;
        _;
        inSwapAndSend = false;
    }

    constructor () {
        _rOwned[_msgSender()] = _rTotal; 
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
         // Create a uniswap pair for this new token
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        // set the rest of the contract variables
        uniswapV2Router = _uniswapV2Router;
        //exclude owner and this contract from fee
        _isExcludedFromFee[owner()] = true; // Owner of smart contract will not pay the fee
        _isExcludedFromFee[address(this)] = true; // smart contract itself will not pay the fee
        teamWallet = _msgSender();
        _isExcludedFromFee[teamWallet] = true;
        emit Transfer(address(0), _msgSender(), _tTotal);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(
        address account
    ) public view override returns (uint256) { 
        if (_isExcluded[account]) return _tOwned[account];
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(
        address recipient, 
        uint256 amount
    ) external override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(
        address owner, 
        address spender
    ) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(
        address spender, 
        uint256 amount
    ) external override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender, 
        address recipient, 
        uint256 amount
    ) external override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(
        address spender, 
        uint256 addedValue
    ) external virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(
        address spender, 
        uint256 subtractedValue
    ) external virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    function isExcludedFromReward(
        address account
    ) external view returns (bool) {
        return _isExcluded[account];
    }

    function totalFees() public view returns (uint256) {
        return _tFeeTotal;
    }

    function deliver(
        uint256 tAmount
    ) external {
        address sender = _msgSender();
        require(!_isExcluded[sender], "PRJX: Excluded addresses cannot call this function");
        (uint256 rAmount,,,,,,) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rTotal = _rTotal.sub(rAmount);
        _tFeeTotal = _tFeeTotal.add(tAmount);
    }

    function reflectionFromToken(
        uint256 tAmount, 
        bool deductTransferFee
    ) external view returns(uint256) {
        require(tAmount <= _tTotal, "PRJX: Amount must be less than supply"); 
        if (!deductTransferFee) { 
            (uint256 rAmount,,,,,,) = _getValues(tAmount);
            return rAmount;
        } else {
            (,uint256 rTransferAmount,,,,,) = _getValues(tAmount);
            return rTransferAmount;
        }
    }

    function tokenFromReflection(
        uint256 rAmount
    ) public view returns(uint256) { 
        require(rAmount <= _rTotal, "PRJX: Amount must be less than total reflections"); 
        uint256 currentRate =  _getRate();
        return rAmount.div(currentRate);
    }

    function excludeFromReward(
        address account
    ) external onlyOwner() {
        require(!_isExcluded[account], "PRJX: Account is already excluded");
        if(_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcluded[account] = true;
        _excluded.push(account);
    }

    function includeInReward(
        address account
    ) external onlyOwner() {
        require(_isExcluded[account], "PRJX: Account is already included");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcluded[account] = false;
                _excluded.pop();
                break;
            }
        }
    }

    function updateExcludeFromFee(
        address account,
        bool _exclude
    ) external onlyOwner {
        _isExcludedFromFee[account] = _exclude;
    }

    event FeeUpdated(uint256 taxFee, uint256 burnFee, uint256 teamFee);
    function setTaxFeePercent(
        uint256 taxFee,
        uint256 burnFee,
        uint256 teamFee
    ) external onlyOwner() {
        _taxFee = taxFee;
        _burnFee = burnFee;
        _teamFee = teamFee;
        _previousTaxFee = taxFee;
        _previousBurnFee = burnFee;
        _previousTeamFee = teamFee;
        emit FeeUpdated(taxFee, burnFee, teamFee);
    }

    event NumOfTokenToSellToSend(uint256 numOfTokens);
    function setNumOfTokenToSellTosend(
        uint256 numOfTokens
    ) external onlyOwner {
        numTokensSellToSend = numOfTokens;
        emit NumOfTokenToSellToSend(numOfTokens);
    }

    function setSwapAndSendEnabled(
        bool _enabled
    ) external onlyOwner {
        swapAndSendEnabled = _enabled;
        emit SwapAndSendEnabledUpdated(_enabled);
    }

     //to recieve ETH from uniswapV2Router when swaping
    receive() external payable {}

    function _reflectFee(
        uint256 rFee, 
        uint256 tFee
    ) private {
        _rTotal = _rTotal.sub(rFee);
        _tFeeTotal = _tFeeTotal.add(tFee);
    }

    function _getValues(
        uint256 tAmount
    ) private view returns (uint256, uint256, uint256, uint256, uint256, uint256, uint256) {
        (uint256 tTransferAmount, uint256 tFee, uint256 tTeam, uint256 tBurn) = _getTValues(tAmount);
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(tAmount, tFee, tTeam, tBurn, _getRate());
        return (rAmount, rTransferAmount, rFee, tTransferAmount, tFee, tTeam, tBurn);
    }

    function _getTValues(
        uint256 tAmount
    ) private view returns (uint256, uint256, uint256, uint256) {
        uint256 tFee = calculateTaxFee(tAmount);
        uint256 tTeam = calculateTeamFee(tAmount);
        uint256 tBurn = calculateBrunFee(tAmount);
        uint256 tTransferAmount = tAmount.sub(tFee).sub(tTeam).sub(tBurn);
        return (tTransferAmount, tFee, tTeam, tBurn);
    }

    function _getRValues(
        uint256 tAmount, 
        uint256 tFee, 
        uint256 tLiquidity, 
        uint256 tBurn, 
        uint256 
        currentRate
    ) private pure returns (uint256, uint256, uint256) {
        uint256 rAmount = tAmount.mul(currentRate);
        uint256 rFee = tFee.mul(currentRate);
        uint256 rLiquidity = tLiquidity.mul(currentRate);
        uint256 rBurn = tBurn.mul(currentRate);
        uint256 rTransferAmount = rAmount.sub(rFee).sub(rLiquidity).sub(rBurn);
        return (rAmount, rTransferAmount, rFee);
    }

    function _getRate() private view returns(uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }  

    function _getCurrentSupply() private view returns(uint256, uint256) {
        uint256 rSupply = _rTotal; 
        uint256 tSupply = _tTotal;

        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_rOwned[_excluded[i]] > rSupply || _tOwned[_excluded[i]] > tSupply) return (_rTotal, _tTotal);
            rSupply = rSupply.sub(_rOwned[_excluded[i]]);
            tSupply = tSupply.sub(_tOwned[_excluded[i]]);
        }
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

    function _takeTeam(
        address from,
        uint256 tTeam
    ) private {
        if(tTeam == 0) return;
        uint256 currentRate =  _getRate();
        uint256 rTeam = tTeam.mul(currentRate);
        _rOwned[address(this)] = _rOwned[address(this)].add(rTeam);
        if(_isExcluded[address(this)])
            _tOwned[address(this)] = _tOwned[address(this)].add(tTeam);
        emit Transfer(from, address(this), tTeam);
    }

    function _takeBurn(
        address from,
        uint256 tBurn
    ) private {
        if(tBurn == 0) return;
        uint256 currentRate =  _getRate();
        uint256 rBurn = tBurn.mul(currentRate);
        _rOwned[DEAD] = _rOwned[DEAD].add(rBurn);
        if(_isExcluded[DEAD])
            _tOwned[DEAD] = _tOwned[DEAD].add(tBurn);
        emit Transfer(from, address(DEAD), tBurn);
    }


    function calculateTaxFee(
        uint256 _amount
    ) private view returns (uint256) {
        return _amount.mul(_taxFee).div(10**2);
    }

    function calculateTeamFee(
        uint256 _amount
    ) private view returns (uint256) { 
        return _amount.mul(_teamFee).div(10**2);
    }

    function calculateBrunFee(
        uint256 _amount
    ) private view returns (uint256) { 
        return _amount.mul(_burnFee).div(10**2);
    }

    function removeAllFee() private {
        if(_taxFee == 0 && _burnFee == 0 && _teamFee == 0) return;

        _previousTaxFee = _taxFee;
        _previousBurnFee = _burnFee;
        _previousTeamFee = _teamFee;

        _taxFee = 0;
        _burnFee = 0;
        _teamFee = 0;
    }

    function restoreAllFee() private {
        _taxFee = _previousTaxFee;
        _burnFee = _previousBurnFee;
        _teamFee = _previousTeamFee;
    }

    function isExcludedFromFee(
        address account
    ) external view returns(bool) {
        return _isExcludedFromFee[account];
    }

    function _approve(
        address owner, 
        address spender, 
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "PRJX: Transfer amount must be greater than zero");

        uint256 contractTokenBalance = balanceOf(address(this));

        bool overMinTokenBalance = contractTokenBalance >= numTokensSellToSend;
        if (
            overMinTokenBalance &&
            !inSwapAndSend &&
            from != uniswapV2Pair &&
            swapAndSendEnabled
        ) {
            contractTokenBalance = numTokensSellToSend;
            swapAndSend(contractTokenBalance);
        }

        //indicates if fee should be deducted from transfer
        bool takeFee = true;

        //if any account belongs to _isExcludedFromFee account then remove the fee
        if(_isExcludedFromFee[from] || _isExcludedFromFee[to]){
            takeFee = false;
        }

        if(from != uniswapV2Pair && to != uniswapV2Pair) {
            takeFee = false;
        }

        //transfer amount, it will take tax, burn, liquidity fee
        _tokenTransfer(from,to,amount,takeFee);
    }

    function swapAndSend(
        uint256 contractTokenBalance
    ) private lockTheSwap {
        // swap tokens for ETH
        swapTokensForEth(contractTokenBalance); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance;
        if(newBalance != 0) {
            (bool success, ) = payable(teamWallet).call{value: newBalance}("");
            require(success, "PRJX: could not send the fund to team wallet");
            emit SwapAndSend(contractTokenBalance, newBalance);
        }

    }

    function swapTokensForEth(
        uint256 tokenAmount
    ) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }


    function _tokenTransfer(
        address sender, 
        address recipient, 
        uint256 amount, 
        bool takeFee
    ) private {
        if(!takeFee)
            removeAllFee();

        if (_isExcluded[sender] && !_isExcluded[recipient]) {
            _transferFromExcluded(sender, recipient, amount);
        } else if (!_isExcluded[sender] && _isExcluded[recipient]) {
            _transferToExcluded(sender, recipient, amount);
        } else if (!_isExcluded[sender] && !_isExcluded[recipient]) {
            _transferStandard(sender, recipient, amount);
        } else if (_isExcluded[sender] && _isExcluded[recipient]) {
            _transferBothExcluded(sender, recipient, amount);
        } else {
            _transferStandard(sender, recipient, amount);
        }

        if(!takeFee)
            restoreAllFee();
    }

    function _transferStandard(
        address sender, 
        address recipient, 
        uint256 tAmount
    ) private {
        (uint256 rAmount,uint256 rTransferAmount,uint256 rFee,uint256 tTransferAmount,
            uint256 tFee,uint256 tTeam,uint256 tBurn) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeTeam(sender, tTeam);
        _takeBurn(sender, tBurn);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferToExcluded(
        address sender, 
        address recipient, 
        uint256 tAmount
    ) private {
        (uint256 rAmount,uint256 rTransferAmount,uint256 rFee,uint256 tTransferAmount,
            uint256 tFee,uint256 tTeam,uint256 tBurn) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);           
        _takeTeam(sender, tTeam);
        _takeBurn(sender, tBurn);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferFromExcluded(
        address sender, 
        address recipient, 
        uint256 tAmount
    ) private {
        (uint256 rAmount,uint256 rTransferAmount,uint256 rFee,uint256 tTransferAmount,
            uint256 tFee,uint256 tTeam,uint256 tBurn) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);   
        _takeTeam(sender, tTeam);
        _takeBurn(sender, tBurn);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferBothExcluded(
        address sender, 
        address recipient, 
        uint256 tAmount
    ) private {
        (uint256 rAmount,uint256 rTransferAmount,uint256 rFee,uint256 tTransferAmount,
            uint256 tFee,uint256 tTeam,uint256 tBurn) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);        
        _takeTeam(sender, tTeam);
        _takeBurn(sender, tBurn);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

